A man who beat his child to death and killed his wife. Crooked politicians suppressing our people. A woman who killed 4 husbands. A theatre star who was taking advantage of and killing the women that auditioned for his productions. A bank owner who.. well the bank owner didn’t actually do anything Clem and I just really wanted the 20,000 dollars hahahah. But hey I gave a lot of that away to people that needed it. I know what it’s like to be treated so unfairly that you just don’t understand why you even exist. These people deserved it. Allowed to freely walk the streets after their heinous crimes and I’m the bad guy? Sure I leave playing cards at the scenes of their deaths and I paint my face.. Hahahah.. but it’s so fun evening the score. The papers of course spin me as some serial killer but I’m ok with it. I know my truths. I’m not a monster. I’m an equalizer. These people fell through the cracks of the system or were put there by the very system itself. One step at a time, I plan to do what I can to even the score for those of us who have been beaten down and discarded like a rotten carcass. I needed to do this. To separate myself from those I love in order to execute my plan without bringing heat on their lives. When my brother was killed, they robbed him only a weeks worth of vegetables. $32 dollars was all it took to end his very existence. Had I been there I would have given them all the money I had to spare his life. Now I must end the lives of those who allow justice to slip through our finger tips in order to continue to fill their pockets. Vipers, Nola, I’m sorry. Monroe, i should have been there the day you died. But you will not die for nothing. I feel you with me and I know this is right.

